import {Component, OnInit} from '@angular/core';
import {Router, RouterEvent} from "@angular/router";
import {LocalStorageService} from "../../../service/local-storage.service";

@Component({
  selector: 'app-navbar',
  templateUrl: './navbar.component.html',
  styleUrls: ['./navbar.component.css']
})
export class NavbarComponent implements OnInit {

  liLogout: HTMLLIElement|null = document.querySelector('.liLogout');
  isLogedIn:boolean = false;
  isAdmin: boolean = false;

  constructor(private readonly router: Router,
              private localStorageService: LocalStorageService) {

  }

  ngOnInit() {
    this.router.events.subscribe((val) => {
      if (val instanceof RouterEvent) {
        if (val.url === '/login' || this.localStorageService.get('user') === null) {
          this.isLogedIn = false;
        } else {
          this.isLogedIn = true;
          this.isAdmin = this.localStorageService.get('user')?.role === 'admin';
        }
      }
    });
  }

  logout() {
    if (confirm('Are you sure you want to logout?')){
      this.localStorageService.remove('user');
      this.router.navigate(['/login']).then();
    }
  }
}



<!DOCTYPE html>
<html lang="pt-br">
<head>
  <meta charset="UTF-8">
  <meta name="viewport" content="width=device-width, initial-scale=1.0">
  <link rel="stylesheet" href="navbar.component.css">
  <title>Plataforma IDEIAS</title>
</head>
<body>
<nav>
  <div class="nav-wrapper">
    <a routerLink="/home" class="brand-logo">IDEIAS</a>
    <ul id="nav-mobile" name="options" class="right hide-on-med-and-down">
      <li><a *ngIf="!isLogedIn" routerLink="/blog">Blog</a></li>
      <li><a *ngIf="isLogedIn" routerLink="/aplicacoes">Aplicações</a></li>
      <li><a *ngIf="isLogedIn" routerLink="/perfil">Perfil</a></li>
      <li><a *ngIf="isLogedIn && isAdmin" routerLink="/configuracoes">Configurações</a></li>
      <li class="logout" *ngIf="isLogedIn" (click)="logout()"><a routerLink="/logout">Sair</a></li>
    </ul>
  </div>
</nav>
</body>
